import { YouTube } from 'popyt';

export default async (req, res) => {
	const {
		query: { id },
	} = req;

	const secrets = {
		key: 'AIzaSyCSp1D7kTrcqNhY2Py_-6qGs1iBixkDr1o',
		channelId: 'UCQ_dGc7VM1kYl19K0viWW4A',
	};

	const { key } = secrets;

	const youtube = new YouTube(key);

	const playlists = await youtube.getChannelPlaylists(key);

	console.log({ playlists });

	res.status(200).json({ playlists });
};
